import { StyleSheet } from 'react-native';

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  inputs: {
    padding: 10,
    borderWidth: 1,
    borderColor: 'green',
    textAling: 'center',
    borderRadius: 10,
    color: 'black',
    textAlign: 'center',
    placeholderTextColor: 'darck-gray',
    fontSize: 25,
    marginTop: 20,
    minWidth: 350,
    height: 60,
    backgroundColor: 'transparent',
  },
  buttons: {
    padding: 10,
    borderRadius: 10,
    width: 150,
    marginTop: 20,
    backgroundColor: 'blue-light',
    minWidth: 200,
    height: 60,
  },
  textbuttons: {
    color: 'white',
    textAlign: 'center',
    fontSize: 25
  },

});

export { styles }
